function getOutput(b,d){var f=$(".list .list-header-name:contains("+b+")").parent().parent();var a=f.children(".list-cards").children(".list-card");var g="https://trello.com";var c=[];for(var e=0;e<a.length;e++){var h=$(a[e]).find(".list-card-title").attr("href");var j=$(a[e]).find(".list-card-title").text();var k=$(a[e]).find(".list-card-title span").text();j=j.replace(k,"");if(j!="Sol Integration progress report"&&j.indexOf("Where we think we'll get")<0){c.push("- "+j+" (["+d+"|"+g+h+"])")}}return c.join("<br>")};